const events = [
    {
        "repairID": 1, 
        "cutsomerName": "Bob",
        "bicycleType": "xx",
        "repairTime": "May 6, 2021"
    }, 
    {
        "repairID": 2, 
        "cutsomerName": "Sue",
        "bicycleType": "yy",
        "repairTime": "May 7, 2021"
    }, 
    {
        "repairID": 3, 
        "cutsomerName": "Alex",
        "bicycleType": "zz",
        "repairTime": "May 4, 2021"
    }
];

export const sampleEvents = events.map(
    event => (
    {
        repairID: event.repairID,
        customerNamr: event.customerName,
        bicycleType: event.bicycleType,
        repairTime: event.repairTime
    })
);
